import React, { Component } from 'react';
import './App.css';
import TodoItem from './components/TodoItem';
import ContactCard from './components/ContactCard';

const App = () => {
  return (
    <div>
      <ContactCard contact={{name:"John Smith", imageUrl:"http://placekitten.com/300/200", phone:"12345678", email:"cat@hotmail.com"}}/>
      <ContactCard name="Mary Smith" imageUrl="http://placekitten.com/400/200" phone="123456789" email="cat2@hotmail.com"/>
      <ContactCard name="Chris Smith" imageUrl="http://placekitten.com/200/200" phone="012345678" email="cat3@hotmail.com"/>
    </div>
  );
}
export default App;
